import { Segment, Header, Image } from "semantic-ui-react";

function Home() {
  return (
    <div>
      <header>
        <Segment inverted>
          <Image
            src="https://res.cloudinary.com/smartrestaurantapi/image/upload/v1629384728/162075162_965618190870570_2873432039017907345_n_hkg18a.jpg"
            circular
            size="medium"
            floated="right"
          ></Image>
          <Header></Header>
        </Segment>
      </header>
    </div>
  );
}

export default Home;
